import { Table, Tbody, Tr, Td} from "@chakra-ui/react";

const TableElement = ({name, email, cpf, age}) => {

  const tableStyle = {
    border: "1px solid white",
  };

  const dataRowStyle = {
    color: "#FFF",
    border: "1px solid white",
  }

  if(!name && !email && !cpf && !age) {
    return null;
  
  }

  return(
    <Table borderWidth="1px" borderColor="white">
      <Tbody>
        <Tr>
            <Td color="#FFF">{name}</Td>
            <Td color="#FFF">{email}</Td>
            <Td color="#FFF">{cpf}</Td>
            <Td color="#FFF">{age}</Td>
        </Tr>
      </Tbody>
    </Table>
  );
}

export default TableElement;
